import React, { useState } from 'react';
import Calendar from 'react-calendar';
import { Link } from 'react-router-dom';
import CustomerTaskList from './../components/CustomerTaskList.js';
import Engagements from '../components/Engagements.js';

function BillPay({ EngagementTypes }) {
    const [key, setVal] = useState(0);
    const [color, setColor] = useState("div1")

    function update(e){
        let newKey = e.target.value
        console.log(newKey)
        if(newKey === 1){
            setColor('div3')
            console.log("This is color: ", color)
        }
        setVal(e.target.value)
    }

    return (
        <>
            <div class="container">
                <div class="toppane">
                    <div class="containerFullHeightDiv">
                        <div class="containerFullWidthDiv">
                            Acme Inc, welcome to the Qualtrics Services Offering Page!
                        </div>
                        <div class="containerFullWidthDiv">
                            <p class="alert">
                                Account Team Managed Alert
                            </p>
                        </div>
                    </div>

                    <div class="containerFullHeightDiv">
                        <table class="rightbutton">
                            <tr>
                                <td></td>
                                <td></td>
                                {/* <td><button class="buttonstyle" onClick={LogOutEventHandler} type="button">Log out</button></td> */}
                            </tr>
                            <tr>
                                <td><Link to="/billpay"><button class="buttonstyle" type="button">Bill Pay</button></Link></td>
                                <td><button class="buttonstyle" type="button">Engagement History</button></td>
                                <td><button class="buttonstyle" type="button">Account Management</button></td>
                            </tr>
                        </table>
                    </div>
                </div>

                <div class="leftpane">
                    <div class="lefttopbox">Recommended Resource 1</div>
                    <div class="leftbottombox">Recommended Resource 2</div>
                </div>

                <div class="middlepane">
                    <div class="centerDiv">
                    <p> What do you want to do today?</p>
                        {/* INSERT COMPONENT TO GENERATE TABS */}
                        {EngagementTypes[key].map((engagement,i) => 
                            <div class="tmpContainerDiv" >
                                <button value={i} class={color} type="button" onClick={update}>
                                    {engagement}
                                </button>
                            </div>
                        )}
                        {/* {EngagementTypes[value].map((engagement) => <Engagements engagements={engagement}></Engagements>)} */}
                    </div>
                </div>

                <div class="rightpane">
                    <p>Open Actions / Tickets</p>
                    {/* <CustomerTaskList tasks={customerTasks}></CustomerTaskList> */}
                </div>
            </div>
        </>
    );
}

export default BillPay
